function Contact() {
    return (
        <section id="contact" class="container mx-auto py-16 px-4">
          <h3 class="text-3xl font-bold text-center mb-8 text-primary">Contact</h3>
          <p class="text-center text-gray-600 mb-10">You can contact me through the following means:</p>

          <div class="grid grid-cols-1 sm:grid-cols-2 gap-6 text-center">
            {/*whatsapp*/}
            <div class="flex flex-col items-center hover:text-green-600 transition">
              <i class="fab fa-whatsapp text-4xl lg:text-6xl text-green-500 mb-2"></i>
              <a href="https://wa.me/34644048205" target="_blank" class="font-medium">+34 644 048 205</a>
            </div>

            {/*Email*/}
            <div class="flex flex-col items-center hover:text-red-600 transition">
              <i class="fas fa-envelope text-4xl lg:text-6xl text-red-500 mb-2"></i>
              <a href="mailto:veronicasanchezjusticia2@gmail.com" class="font-medium">veronicasanchezjusticia2@gmail.com</a>
            </div>

            {/*LinkedIn*/}
            <div class="flex flex-col items-center hover:text-blue-700 transition">
              <i class="fab fa-linkedin text-4xl lg:text-6xl text-blue-700 mb-2"></i>
              <a href="https://www.linkedin.com/in/ver%C3%B3nica-s%C3%A1nchez-justicia-825a7421a/" target="_blank" class="font-medium">LinkedIn</a>
            </div>

            
            {/* <!-- Portfolio --> */}
            <div class="flex flex-col items-center hover:text-purple-600 transition">
              <i class="fas fa-globe text-4xl lg:text-6xl text-purple-600 mb-2"></i>
              <a href="https://veronicasj.github.io/Portfolio/" target="_blank" class="font-medium">Portfolio</a>
            </div>

            
            {/* GitHub */}
            <div class="flex flex-col items-center hover:text-gray-900 transition sm:col-span-2">
              <i class="fab fa-github text-4xl lg:text-6xl text-gray-800 mb-2"></i>
              <a href="https://github.com/VeronicaSj" target="_blank" class="font-medium">GitHub</a>
            </div>
          </div>
        </section>
    );
}

export default Contact;
